import React from 'react';
import './ArticleList.css';
import { Article } from '../Article/Article';

export class ArticleList extends React.Component {
  render() {
    return (
      <ul>
        <div className="row">
          <div className="column">
            <Article image={this.props.category} />
            <Article image={this.props.category} />
            <Article image={this.props.category} />
            <Article image={this.props.category} />
          </div>
          <div className="column">
            <Article image={this.props.category} />
            <Article image={this.props.category} />
            <Article image={this.props.category} />
            <Article image={this.props.category} />
          </div>
        </div>
      </ul>
    )
  }
}
